import React from 'react';
import "./Classes.css";
// Data Structure: List of classes
const classesData = [
  {
    name: "Yakshagana",
    teacher: {
      name: "Ganapathi Bhat",
      photo: "/images/ganapathibhat.jpg"
    },
    day: "Monday & Tuesday",
    time: "3:30 PM - 6:30 PM",
    totalHours: "3/day",
    fees: "INR 2000/month",
    rating: 4.8,
  },
  {
    name: "Bharatanatyam",
    teacher: {
      name: "Ananya Reddy",
      photo: "/images/yakshagana.jpg"
    },
    day: "Wednesday & Thrusday",
    time: "6:00 PM - 7:30 PM",
    totalHours: 1.5,
    fees: "$50",
    rating: 4.7, // Rating out of 5
    image: "path/to/class-image.jpg", // Optional: background image for the class card
  },
  {
    name: "Kathak",
    teacher: {
      name: "Ravi Kumar",
      photo: "kathak.jpg"
    },
    day: "Wednesday",
    time: "5:00 PM - 6:30 PM",
    totalHours: 1.5,
    fees: "$60",
    rating: 4.5,
    image: "path/to/class-image2.jpg", // Optional: background image
  },
  {
    name: "Odissi",
    teacher: {
      name: "Ravi Kumar",
      photo: "kathak.jpg"
    },
    day: "Friday & saturday",
    time: "5:00 PM - 6:30 PM",
    totalHours: 4.5,
    fees: "$60",
    rating: 4.7,
    image: "path/to/class-image2.jpg", // Optional: background image
  },
  {
    name: "Mohiniyattam",
    teacher: {
      name: "Ravi Kumar",
      photo: "kathak.jpg"
    },
    day: "Wednesday",
    time: "5:00 PM - 6:30 PM",
    totalHours: 4.3,
    fees: "$60",
    rating: 4.7,
    image: "path/to/class-image2.jpg", // Optional: background image
  },
  {
    name: "Hip-Hop",
    teacher: {
      name: "Ravi Kumar",
      photo: "kathak.jpg"
    },
    day: "Wednesday",
    time: "5:00 PM - 6:30 PM",
    totalHours: 1.5,
    fees: "$60",
    rating: 4.7,
    image: "path/to/class-image2.jpg", // Optional: background image
  },
  {
    name: "Bollywood",
    teacher: {
      name: "Ravi Kumar",
      photo: "kathak.jpg"
    },
    day: "Wednesday",
    time: "5:00 PM - 6:30 PM",
    totalHours: 1.5,
    fees: "$60",
    rating: 4.7,
    image: "path/to/class-image2.jpg", // Optional: background image
  },
  {
    name: "Contemporary",
    teacher: {
      name: "Ravi Kumar",
      photo: "kathak.jpg"
    },
    day: "Wednesday",
    time: "5:00 PM - 6:30 PM",
    totalHours: 1.5,
    fees: "$60",
    rating: 4.7,
    image: "path/to/class-image2.jpg", // Optional: background image
  },
  {
    name: "Salsa",
    teacher: {
      name: "Ravi Kumar",
      photo: "kathak.jpg"
    },
    day: "Wednesday",
    time: "5:00 PM - 6:30 PM",
    totalHours: 1.5,
    fees: "$60",
    rating: 4.7,
    image: "path/to/class-image2.jpg", // Optional: background image
  },
  {
    name: "Tap Dance",
    teacher: {
      name: "Ravi Kumar",
      photo: "kathak.jpg"
    },
    day: "Wednesday",
    time: "5:00 PM - 6:30 PM",
    totalHours: 1.5,
    fees: "$60",
    rating: 4.7,
    image: "path/to/class-image2.jpg", // Optional: background image
  },
];

// ClassCard Component: Displays details of a single class
const ClassCard = ({ classItem }) => {
  return (
    <div className="class-card" >
      <div className="class-card-content">
        <h2>{classItem.name}</h2>
        <div className="teacher-details">
          <img src={classItem.teacher.photo} alt={classItem.teacher.name} className="teacher-img" />
          <p><strong>Instructor:</strong> {classItem.teacher.name}</p>
        </div>
        <p><strong>Day:</strong> {classItem.day}</p>
        <p><strong>Time:</strong> {classItem.time}</p>
        <p><strong>Hours:</strong> {classItem.totalHours}</p>
        <p><strong>Fees:</strong> {classItem.fees}</p>
        <p><strong>Rating:</strong> {classItem.rating} ⭐</p>
      </div>
    </div>
  );
};

// ClassesPage Component: Displays all class cards
const ClassesPage = () => {
  return (
    <div className="classes-container">
      {classesData.map((classItem, index) => (
        <ClassCard key={index} classItem={classItem} />
      ))}
    </div>
  );
};

export default ClassesPage;
